      if (!v) return null;
      if (v.indexOf('%') >= 0 || v.indexOf('vw') >= 0) {
        return parseInt(v, 10) / 100 * app.width;
      }
      const newV = parseInt(v, 10);
      if (Number.isNaN(newV)) return null;
